INSERT INTO `informacionnotificacioncorreo` (`innocoid`, `innoconombre`, `innocoasunto`, `innococontenido`, `innocoenviarpiepagina`, `innocoenviarcopia`, `created_at`, `updated_at`) VALUES
(1, 'piePaginaCorreo', 'Pie página correo', '<p style=\"text-align: justify;\"><strong>Para su inter&eacute;s</strong>:&nbsp;<br /><br /><span style=\"font-size: 10pt;\">1. Este correo fue generado autom&aacute;ticamente, por favor no responda a &eacute;l.</span><br /><span style=\"font-size: 10pt;\">2. La informaci&oacute;n contenida en esta comunicaci&oacute;n es confidencial y s&oacute;lo puede ser utilizada por la persona natural o jur&iacute;dica a la cual est&aacute; dirigida.</span><br /><span style=\"font-size: 10pt;\">3. Si no es el destinatario autorizado, cualquier retenci&oacute;n, difusi&oacute;n, distribuci&oacute;n o copia de este mensaje, se encuentra prohibida y sancionada por la ley.</span><br /><span style=\"font-size: 10pt;\">4. Si por error recibe este mensaje, favor reenviar y borrar el mensaje recibido inmediatamente\". (Resoluci&oacute;n No. 089 de 2003 - Reglamento para el uso de Internet y Correo Electr&oacute;nico en el AGN. Art&iacute;culo 3&deg; numeral 5.</span></p>', 0, 0, CURRENT_TIMESTAMP, CURRENT_TIMESTAMP),
(2, 'registroUsuario', '¡Bienvenido al CRM de siglaCooperativa!', '<p class=\"MsoNormal\" style=\"text-align: justify;\">Estimado <strong>nombreUsuario</strong>, Es un placer informarle que a partir de este momento, la <strong>nombreEmpresa </strong>ha implementado un nuevo y avanzado Sistema de Gesti&oacute;n de Relaciones con el Cliente (CRM). Este sistema ha sido dise&ntilde;ado para mejorar significativamente nuestros procesos internos y proporcionarle a usted, como usuario, una experiencia m&aacute;s eficiente y personalizada.<br><br></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\">A continuaci&oacute;n, encontrar&aacute; los detalles clave de esta actualizaci&oacute;n:<br><br></p>\r\n<p class=\"MsoNormal\">URL del Sistema: <strong><a href=\"urlSistema\" target=\"_blank\">urlSistema</a> </strong><br>Usuario del CRM: <strong>usuarioSistema</strong><br>Credenciales de acceso: <strong>contrasenaSistema</strong></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><br>Este nuevo CRM le permitir&aacute;:</p>\r\n<ul>\r\n<li class=\"MsoNormal\" style=\"text-align: justify;\">Acceder a su informaci&oacute;n y estado de cuenta de manera r&aacute;pida y sencilla.</li>\r\n<li class=\"MsoNormal\" style=\"text-align: justify;\">Realizar seguimiento de sus transacciones y solicitudes.</li>\r\n<li class=\"MsoNormal\" style=\"text-align: justify;\">Comunicarse de manera efectiva con nuestro equipo de trabajo.</li>\r\n<li class=\"MsoNormal\" style=\"text-align: justify;\">Acceder a servicios y recursos exclusivos para miembros de la Cooperativa.</li>\r\n<li class=\"MsoNormal\" style=\"text-align: justify;\">Le recomendamos que cambie su contrase&ntilde;a inicial despu&eacute;s de su primer inicio de sesi&oacute;n para garantizar la seguridad de su cuenta.</li>\r\n</ul>\r\n<p>Estamos comprometidos en brindarle un servicio de la m&aacute;s alta calidad, y creemos que esta actualizaci&oacute;n nos permitir&aacute; servirle de manera m&aacute;s efectiva. Si tiene alguna pregunta o necesita asistencia para familiarizarse con el nuevo sistema, no dude en ponerse en contacto con nuestro equipo de tecn&oacute;loga, quienes estar&aacute;n encantados de ayudarle.</p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\">Agradecemos su confianza en la nombreEmpresa y esperamos que este nuevo CRM mejore su experiencia con nosotros. Estamos seguros de que encontrar&aacute; el sistema m&aacute;s intuitivo y &uacute;til.</p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\">&iexcl;Bienvenido al futuro de la nombreEmpresa!</p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\">Atentamente,</p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p class=\"MsoNormal\"><strong>nombreGerente</strong><br><strong>Gerente general </strong><br><strong>nombreEmpresa</strong></p>\r\n<p>&nbsp;</p>', 1, 0, CURRENT_TIMESTAMP, CURRENT_TIMESTAMP),
(3, 'solicitaFirmaDocumento', 'Solicitud de firma para del documento con referencia numeroDocumental', '<p class=\"MsoNormal\" style=\"text-align: justify;\">Estimado <strong>nombreFeje</strong>, por medio de la presente me permito informar que se ha generado un documento importante que requiere su aprobaci&oacute;n y firma.</p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\">Detalles del documento:</p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\">Tipo de documento: <strong>tipoDocumental</strong><br>N&uacute;mero de documento: <strong>numeroDocumental</strong><br>Fecha de generaci&oacute;n: <strong>fechaDocumento</strong></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\">Por favor, revise el documento y proceda a firmarlo utilizando la plataforma de CRM de nuestra cooperativa. Si tiene alguna pregunta o inquietud sobre el contenido del documento o el proceso de firma, no dude en contactarme.</p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\">Su cooperaci&oacute;n en este asunto es altamente apreciada y fundamental para avanzar en este proceso de manera oportuna.</p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\">Quedo a su disposici&oacute;n para cualquier aclaraci&oacute;n adicional que pueda necesitar.<br><br></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\">Atentamente,<br><br></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><em><strong>nombreUsuario</strong></em><br><em><strong>cargoUsuario</strong></em></p>', 1, 0, CURRENT_TIMESTAMP, CURRENT_TIMESTAMP),
(4, 'anularSolicitudFirmaDocumento', 'Revisión y ajustes necesarios para documento con referencia numeroDocumental', '<p class=\"MsoNormal\" style=\"text-align: justify;\">Estimado <strong>nombreFeje</strong>, le informo que el documento <strong>tipoDocumental </strong>con el n&uacute;mero <strong>numeroDocumental</strong>, que est&aacute; programado para su firma, requiere algunos ajustes y revisiones antes de que podamos proceder con el proceso de firma.</p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\">Detalles del documento:</p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\">Tipo de documento: <strong>tipoDocumental</strong><br>N&uacute;mero de documento: <strong>numeroDocumental</strong><br>Fecha de generaci&oacute;n: <strong>fechaDocumento</strong></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\">Los ajustes necesarios est&aacute;n relacionados con &ldquo;<em>observacionAnulacionFirma</em>&rdquo;</p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\">Tan pronto como realice los ajustes, estaremos listos para proceder con el proceso de firma.</p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\">Quedo a su disposici&oacute;n para cualquier aclaraci&oacute;n adicional que pueda necesitar.<br><br></p>\r\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; text-align: justify; line-height: normal;\"><span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',serif; mso-fareast-font-family: \'Times New Roman\'; mso-font-kerning: 0pt; mso-ligatures: none; mso-fareast-language: ES-CO;\">Atentamente,<br><br></span></p>\r\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; text-align: justify; line-height: normal;\"><strong><em>nombreUsuario</em></strong><br><strong><em>cargoUsuario</em></strong></p>', 1, 0, CURRENT_TIMESTAMP, CURRENT_TIMESTAMP),
(5, 'notificarEnvioDocumento', 'Envío de documento digital de la Cooperativa siglaCooperativa con referencia numeroDocumental', '<p style=\"text-align: justify;\">Estimado/a <strong>nombreUsuario</strong>,</p>\r\n<p style=\"text-align: justify;\">Por medio de la presente nos permitimos informar que la dependencia de <strong>nombreDependencia </strong>de la <strong>nombreEmpresa </strong>ha enviado un documento en formato digital. Este archivo adjunto contiene la informaci&oacute;n requerida y puede ser revisado en su dispositivo electr&oacute;nico.</p>\r\n<p style=\"text-align: justify;\"><br>Si tiene alguna pregunta o necesita asistencia adicional, no dude en ponerse en contacto con nuestro equipo de soporte.</p>\r\n<p style=\"text-align: justify;\"><br>Agradecemos su colaboraci&oacute;n.</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p>Atentamente,</p>\r\n<p>&nbsp;</p>\r\n<p><em><strong>jefeDependencia</strong></em><br><em><strong>nombreEmpresa</strong></em><br><em><strong>nombreDependencia</strong></em></p>', 1, 0, CURRENT_TIMESTAMP, CURRENT_TIMESTAMP),
(6, 'notificarFirmadoDocumento', 'Solicitud de token de verificación para el firmado del documento numeroDocumental', '<p class=\"MsoNormal\" style=\"text-align: justify;\">Estimado <strong>nombreJefe</strong>, para avanzar con el proceso de firma electr&oacute;nica del documento <strong>numeroDocumental</strong>, es necesario que ingrese el siguiente c&oacute;digo de verificaci&oacute;n:</p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><strong>C&oacute;digo de Verificaci&oacute;n:&nbsp;<em>tokenAcceso</em></strong></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><br>Tenga en cuenta que este token de verificaci&oacute;n ser&aacute; v&aacute;lido durante los pr&oacute;ximos&nbsp;<strong>tiempoToken </strong>minutos. Si transcurre este tiempo sin completar el proceso, deber&aacute; solicitar un nuevo token.</p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\">Por favor, acceda a nuestra plataforma y proporcione el token que le hemos proporcionado. Luego, haga clic en el bot&oacute;n de firma para completar el proceso.</p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\">Gracias por su colaboraci&oacute;n y compromiso con la seguridad de nuestros servicios.</p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\">Atentamente,</p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\">Administrador del CRM</p>', 1, 0, CURRENT_TIMESTAMP, CURRENT_TIMESTAMP),
(7, 'notificarRegistroRadicado', 'Nuevo documento radicado en la Ventanilla Única Virtual con consecutivo numeroRadicado', '<p style=\"text-align: justify;\">Estimado <strong>nombreUsuario</strong>, agradecemos el uso del servicio prestado por la Ventanilla &Uacute;nica de la nombreEmpresa. Queremos informarle que su documento ha sido radicado con los siguientes detalles:</p>\r\n<p style=\"text-align: justify;\"><em>N&uacute;mero de radicado:&nbsp; &nbsp;<strong>numeroRadicado</strong></em><br><em>Fecha de radicado:&nbsp; &nbsp; &nbsp; &nbsp;<strong>fechaRadicado</strong></em><br><em>Destino:&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <strong>nombreDependencia</strong></em><br><em>Radicado por:&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong>nombreFuncionario</strong></em></p>\r\n<p style=\"text-align: justify;\">Le recordamos que la funci&oacute;n de la Ventanilla &Uacute;nica es recibir, radicar y redireccionar su solicitud, cumpliendo con los criterios b&aacute;sicos, ante la instancia correspondiente. La respuesta ser&aacute; proporcionada por la oficina indicada en su comunicaci&oacute;n.</p>\r\n<p style=\"text-align: justify;\">Quedamos a su disposici&oacute;n para cualquier consulta adicional.</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\">Atentamente,</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\">Ventanilla &Uacute;nica<br>nombreEmpresa</p>', 1, 0, CURRENT_TIMESTAMP, CURRENT_TIMESTAMP),
(8, 'notificarRadicadoDocumento', 'Nuevo documento radicado con consecutivo numeroRadicado', '<p style=\"text-align: justify;\">Estimado usuario de <strong>nombreDependencia</strong>, les informamos que ha llegado un nuevo documento a trav&eacute;s de la Ventanilla &Uacute;nica, el cual ha sido debidamente radicado con los siguientes detalles:</p>\r\n<p style=\"text-align: justify;\">Radicado:&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <strong>numeroRadicado</strong><br>Fecha de recepci&oacute;n:&nbsp; <strong>fechaRadicado</strong><br>Destino:&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<strong>nombreDependencia</strong><br>Radicado por:&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <strong>nombreFuncionario</strong></p>\r\n<p style=\"text-align: justify;\">Queremos recordarles que, de acuerdo con los procedimientos, se tiene un plazo de 15 d&iacute;as h&aacute;biles para proporcionar una respuesta a esta solicitud. Este plazo iniciar&aacute; a partir del d&iacute;a siguiente a la radicaci&oacute;n.</p>\r\n<p style=\"text-align: justify;\">Por favor, tomen en cuenta que para acceder al contenido completo, les recomendamos ingresar al nuestro CRM institucional.</p>\r\n<p style=\"text-align: justify;\">Agradecemos su compromiso y dedicaci&oacute;n en pro del mejoramiento continuo de nuestros procesos.</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\">Atentamente,</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\">Ventanilla &Uacute;nica<br>nombreEmpresa</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>', 1, 0, CURRENT_TIMESTAMP, CURRENT_TIMESTAMP),
(9, 'notificarFirmaTipoDocumental', 'Proceso de firmado exitoso del tipo documental tipoDocumental', '<p class=\"MsoNormal\" style=\"text-align: justify;\"><span lang=\"ES\" style=\"mso-ansi-language: ES;\">Estimado usuario de la dependencia <strong>nombreDependencia</strong>, por medio de la presente me permito informar que el tipo documental \"<strong>tipoDocumental</strong>\"&nbsp;<strong>&nbsp;</strong>ha sido correctamente firmado y est&aacute; listo para avanzar al siguiente paso en el proceso.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span lang=\"ES\" style=\"mso-ansi-language: ES;\">Por favor, procede con el sellamiento y cualquier otra acci&oacute;n necesaria para completar este proceso de manera satisfactoria.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span lang=\"ES\" style=\"mso-ansi-language: ES;\">Si tienes alguna pregunta o necesitas asistencia adicional, no dudes en contactarme. Agradezco tu atenci&oacute;n y dedicaci&oacute;n en este asunto.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span lang=\"ES\" style=\"mso-ansi-language: ES;\">Atentamente,<br><br></span></p>\r\n<p class=\"MsoNormal\"><em><strong><span lang=\"ES\" style=\"mso-ansi-language: ES;\">nombreJefe<br></span><span lang=\"ES\" style=\"mso-ansi-language: ES;\">cargoJefe</span></strong></em></p>', 1, 0, CURRENT_TIMESTAMP, CURRENT_TIMESTAMP);
